import React, { Fragment } from 'react';
import Breadcrumb from '../../common/breadcrumb';
import NumericLabel from 'react-pretty-numbers';

const Default = () => {
    let myNumber = 123456;
    let params = {
        justification: 'L',
        locales : 'en-AU',
        currency: true,
        percentage: false,
        precision: 2,
        commafy: false,
        shortFormat: true,
        title: true,
        cssClass: ['class1', 'class2']
      };


    return (
        <Fragment>
            <Breadcrumb parent="Inwarding" title="Add Invoice" />
            <div className="container-fluid">
                <div className="row">
                    <div className="col-sm-12">
                        <div className="card">
                            <div className="card-header">
                                <h5>Home Page</h5><span>Under construcion</span>
                            </div>
                            <div className="card-body">
                            <NumericLabel params={params}>{myNumber}</NumericLabel>;
                            </div>

                        </div>
                    </div>
                </div>
            </div>
        </Fragment>
    );
};

export default Default;
